import { Fragment } from 'react'
import logo from '../assets/images/logo.png'
import {Link } from 'react-router-dom'
import loginLogo from '../assets/images/main_login_pic.png'
import googleLogo from '../assets/images/google_icon.png'
import Footer from '../general/Footer'
import Register from '../sign_up/Register'
import fontawesome from '../assets/font/fontawesome-free-6.2.0-web/css/all.min.css'
export default function Login(props) {
    function login() {
        getUser(handleLogin);
    }
    function getUser(callback) {
        return {
            username: 'test@gmail.com',
            password: '123456'
        }
        // fetch(userApi)
        // .then(function(response) {
        //     return response.json();
        // })
        // .then(callback);
    }
    
    function handleLogin(datas) {
        var btnLogin = document.getElementById('js-login-btn');
        btnLogin.onclick = function() {
            var username = document.querySelector('input[name="username"]').value;
            var password = document.querySelector('input[name="password"]').value;
            var username_cur = '';
            var avatar_cur = '';
            if (username=='' || password=='') {
                console.log('Please enter your username and password');
            }
            var flat = false;
            datas.forEach(data => {
                if (data.username === username && data.password === password) {
                    flat = true;
                    username_cur = username;
                    avatar_cur = data.avatar;
                }
            });
            if (flat) {
                // hideAuthForm();
                // hideAuthButton();
                var userBlock = document.querySelector('#header__navbar-list');
    
                let htmls = datas.map(function(user) {
                    if (user.username===username_cur){
                    return `
                    <li class="header__navbar-item header__navbar-user">
                    <img src="${avatar_cur}" alt="" class="header__navbar-user-img">
                    <span class="header__navbar-user-name">${username_cur}</span>
                    <ul class="header__navbar-user-menu">
                        <li class="header__navbar-user-item">
                            <a href="">Tài khoản của tôi</a>
                        </li>
                        <li class="header__navbar-user-item">
                            <a href="">Đơn mua</a>
                        </li>
                        <li class="header__navbar-user-item">
                            <a href="">Đăng xuất</a>
                        </li>
                    </ul>
                    </li> 
                    `;
                }
            }
            );
                userBlock.innerHTML = htmls.join('');
    
            }
        }
    }
    return (
        <Fragment>
            {/* header */}
            <header className="header">
                <div className="grid wide header__control">
                    <ul className="header__1">
                        <li className="list__logo">
                            <a className="header__logo-link" href="/#">
                                <img className="header__img" src={logo} alt="Logo" />
                            </a>
                        </li>
                        <li className="list__login">
                            <div className="header__text">SIGN IN</div>
                        </li>
                    </ul>
                    <div className="header__help">
                        <a className="help__text" href="/#">Need help?</a>
                    </div>
                </div>
            </header>
            {/* container */}
            <div className="container">
                <div className="grid wide">
                    <div className="row">
                        <div className="l-6 img__control">
                            <img className="img__login" src={loginLogo} alt=""/>
                        </div>
                        <div className="l-6 form__control">
                            <div className="auth-form">
                                <h4 className="auth-form__title">FLOWER CORNER</h4>
                                <p className="auth-form__des">Login to your account</p>
                                <div className="auth-form__form">
                                    <div className="auth-form__group">
                                        <input name="username" placeholder="Email" type="email"  className="auth-form__input"/>
                                    </div>
                                    <div className="auth-form__group">
                                        <input name="password" placeholder="Password" type="password" className="auth-form__input"/>

                                    </div>
                                </div>
                                <div className="auth-form__control">
                                    <button id='js-login-btn' className="btn btn__auth">SIGN IN</button>
                                </div>
                                <div className="auth-form__aside">
                                    <p className="auth-form__text">Don't have account?
                                        <Link to="/register" className="auth-form__text-link">Sign Up</Link>
                                    </p>
                                </div>
                                <p className="auth-form__or">or</p>
                                <div className="auth-form__social">
                                    <a className="auth-form__social-link" href="/#">
                                        <i className="fab fa-facebook-square auth-form__socials-icon-fb"></i>
                                        <span className="auth-form__label">Sign in with Facebook</span>
                                    </a>
                                    <a className="auth-form__social-link" href="/#">
                                        <img src={googleLogo} alt="google icon" className="auth-form__socials-icon-gg"/>
                                        <span className="auth-form__label">Sign in with Google</span>
                                    </a>
                                    <a className="auth-form__social-link" href="/#">
                                        <i className="fab fa-apple auth-form__socials-icon-ap"></i>
                                        <span className="auth-form__label">Sign in with Apple</span>
                                    </a>
                                </div>

                            </div>
                        </div>
                    </div>
                </div>
            </div>
            {/* Footer */}
            <Footer/>
        </Fragment>
    )
}
